  <script>
    const svg2 = document.getElementById("svg2");
    const title = document.getElementById("title");
    const counter = document.getElementById("counter");
    const sound1 = document.getElementById("ohyeah-sound");
    const sound2 = document.getElementById("wave-sound");
    const memeLine = document.getElementById("meme-line");

    const memes = [
      "這片海我罩的 🐳",
      "歐耶！再來一次！",
      "你喚醒了神鯨之力！",
      "天降鯨拳⚡",
      "沒有人能逃出海浪的制裁",
      "點一下也太爽 😎",
      "鯨魚：我來了！",
      "召喚成功！海之霸主現身！"
    ];

    let clicked = 0;

    document.body.addEventListener("click", () => {
      clicked += 1;
      counter.textContent = "點擊次數：" + clicked;

      const random = Math.floor(Math.random() * memes.length);
      memeLine.textContent = memes[random];

      document.body.classList.add("fullscreen-bg");
      svg2.style.display = "flex";
      title.textContent = "召喚中...";

      sound1.currentTime = 0;
      sound2.currentTime = 0;
      sound1.play();
      sound2.play();

      setTimeout(() => {
        svg2.style.display = "none";
        document.body.classList.remove("fullscreen-bg");
        title.textContent = "點一下 召喚神鯨 ✨🐋✨";
      }, 2500);
    });
